<template>
  <div class="visit">
    <b-container>
      <b-row>
        <b-col class="visit__title" lg="12">
          <h2>PLACES TO VISIT</h2>
        </b-col>
        <b-col sm="6" md="4" lg="3" v-for="(image,index) of images" :key="index" >
          <div class="visit__card">
<!--            <img :src="require(`../assets/images/rooms/${image.url}`)" alt=""/>-->
            <img :src="image.url" alt="">
            <div class="visit__text" @click="show(index)">
              <h6>{{image.title}}</h6>
            </div>
          </div>
        </b-col>

      </b-row>
    </b-container>
    <div class="visit__modal" v-if="visible" @click.stop="hide">
      <button @click="hide" type="button" class="close">
      <i></i>
      <i></i>
      </button>
        <div class="modal__content">
            <div class="visit__img" @click.stop="">
<!--              <img :src="require(`../assets/images/rooms/${images[id].url}`)" alt=""/>-->
              <img :src="images[id].url" alt="">
            </div>
            <div class="prev"
                 @click.stop="prev"
                 :class="{'invisible': ! hasPrev()}">
              <svg fill="#FFB612" height="40" viewBox="0 0 23 23" width="40" xmlns="http://www.w3.org/2000/svg">
                <path d="M15.41 16.09l-4.58-4.59 4.58-4.59L14 5.5l-6 6 6 6z"/>
                <path d="M0-.5h24v24H0z" fill="none"/>
              </svg>
            </div>
            <div class="next"
                 @click.stop="next"
                 :class="{'invisible': ! hasNext()}">
              <svg fill="#FFB612" height="40" viewBox="0 0 23 23" width="40" xmlns="http://www.w3.org/2000/svg">
                <path d="M8.59 16.34l4.58-4.59-4.58-4.59L10 5.75l6 6-6 6z"/>
                <path d="M0-.25h24v24H0z" fill="none"/>
              </svg>
            </div>
      </div>
      </div>
    </div>
</template>
<script>
  export default {
    data() {
      return {
        images: [
          {
            url: 'data:image/jpeg;base64,',
            title: 'Place 1',
          },
          {
            url: 'data:image/jpeg;base64,',
            title: 'Place 2',
          },
          {
            url: 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRd50lR02CRYKzLNuPURuggcOei9RInX6966A&usqp=CAU',
            title: 'Place 3',
          },
          {
            url: 'data:image/jpeg;base64,',
            title: 'Place 4',
          },
        ],
        id: 0,
        index: 0,
        visible: false
      }
    },
    methods: {
      show(id) {
        this.visible = true;
        this.id = id;
      },
      hide() {
        this.visible = false;
        this.id = 0;
      },
      hasNext() {
        return this.id + 1 < this.images.length;
      },
      hasPrev() {
        return this.id - 1 >= 0;
      },
      prev() {
        if (this.hasPrev()) {
          this.id -= 1;
        }
      },
      next() {
        if (this.hasNext()) {
          this.id += 1;
        }
      },
    }
  }
</script>
